import { Link } from 'react-router-dom';
import './Pay1.css';

function Pay1({ setModal }) {
  const closeModal = () => {
    setModal(false);
  };

  const text = '아래의 카드 리더기에 카드를 꽂아주세요!';
  return (
    <div class="info-container">
      <p>{text}</p>
      <Link to="payOK">
        <button id="okButton" onClick={closeModal}>
          완료
        </button>
      </Link>
      <button id="cancelButton" onClick={closeModal}>
        취소
      </button>
    </div>
  );
}

export default Pay1;
